import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { Ionicons } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';
import { useApp } from '../context/AppContext';

const OnboardingScreen = () => {
  const navigation = useNavigation();
  const { dispatch } = useApp();

  const handleComplete = () => {
    // Create a mock user
    const user = {
      id: '1',
      name: 'Investor',
      age: 25,
      sectors: ['Technology', 'Healthcare'],
      riskTolerance: 'moderate' as const,
      investmentStyle: ['Growth'],
      portfolio: [],
      watchlist: [],
      preferences: {
        notifications: true,
        darkMode: true,
        emailUpdates: false,
      },
    };

    dispatch({ type: 'SET_USER', payload: user });
    navigation.navigate('Main' as never);
  };

  return (
    <LinearGradient
      colors={['#0f0f23', '#1a1a2e', '#16213e']}
      style={styles.container}
    >
      <View style={styles.content}>
        <View style={styles.iconContainer}>
          <Ionicons name="rocket" size={80} color="#00d4ff" />
        </View>
        
        <Text style={styles.title}>Welcome to Quantix</Text>
        <Text style={styles.subtitle}>
          Your AI-powered investment companion
        </Text>
        
        <View style={styles.features}>
          <View style={styles.feature}>
            <Ionicons name="analytics" size={24} color="#00d4ff" />
            <Text style={styles.featureText}>Smart Recommendations</Text>
          </View>
          <View style={styles.feature}>
            <Ionicons name="people" size={24} color="#8b5cf6" />
            <Text style={styles.featureText}>Community Insights</Text>
          </View>
          <View style={styles.feature}>
            <Ionicons name="shield-checkmark" size={24} color="#10b981" />
            <Text style={styles.featureText}>Secure & Reliable</Text>
          </View>
        </View>

        <TouchableOpacity
          style={styles.button}
          onPress={handleComplete}
          activeOpacity={0.8}
        >
          <LinearGradient
            colors={['#00d4ff', '#0099cc']}
            style={styles.buttonGradient}
          >
            <Text style={styles.buttonText}>Get Started</Text>
            <Ionicons name="arrow-forward" size={20} color="white" />
          </LinearGradient>
        </TouchableOpacity>
      </View>
    </LinearGradient>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 20,
  },
  content: {
    alignItems: 'center',
    width: '100%',
  },
  iconContainer: {
    width: 120,
    height: 120,
    borderRadius: 60,
    backgroundColor: 'rgba(0, 212, 255, 0.1)',
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 30,
    borderWidth: 2,
    borderColor: 'rgba(0, 212, 255, 0.3)',
  },
  title: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 10,
    textAlign: 'center',
  },
  subtitle: {
    fontSize: 16,
    color: '#8b9dc3',
    textAlign: 'center',
    marginBottom: 40,
  },
  features: {
    width: '100%',
    marginBottom: 50,
  },
  feature: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 20,
    paddingHorizontal: 20,
  },
  featureText: {
    fontSize: 16,
    color: '#ffffff',
    marginLeft: 15,
  },
  button: {
    width: '100%',
    borderRadius: 12,
    overflow: 'hidden',
  },
  buttonGradient: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    paddingVertical: 16,
    paddingHorizontal: 32,
  },
  buttonText: {
    fontSize: 18,
    fontWeight: 'bold',
    color: 'white',
    marginRight: 10,
  },
});

export default OnboardingScreen;
